style.css:
@-moz-document domain("bilibili.com") {
  .bpui-slider-progress
  {
    height: 6px !important;
    background: url("data:image/png;base64,") repeat-x !important;
  }

  .bilibili-player-video-progress-buffer-range
  {
    height: 4px !important;
    border-radius: 3px !important;
    margin-top: 1px !important;
    background: url("data:image/gif;base64,") !important;
  }

  .bilibili-player-video-btn-send
  {
    background-color: #d14836;
    border: mistyrose;
  }

@keyframes hc1
  {
    0%   {transform: scale(1.1)rotate(0);
    color: green;
    box-shadow: 0 0 15px pink;
  }

  50%
  {
    transform: scale(1.1)rotate(180deg);
    color: red;
    box-shadow: 0 0 16px pink;
  }

  100%
  {
    transform: scale(1.1)rotate(360deg);
    color: blue;
    box-shadow: 0 0 15px pink;
  }
}

@keyframes hc2
{
  0%
  {
    transform: scale(1.3)rotate(0);
    color: blue;
    box-shadow: 0 0 17px linen;
  }

  50%
  {
    transform: scale(1.5)rotate(180deg);
    color: red;
    box-shadow: 0 0 0 linen;
  }

  100%
  {
    transform: scale(1.3)rotate(360deg);
    color: green;
    box-shadow: 0 0 17px linen;
  }
}

.bpui-slider-handle
{
  border: 0.5px dotted red;
  border-radius: 2px !important;
  font-family: 黑体 !important;
  font-size: 13px !important;
  line-height: 0.71;
  animation: hc1 0.3s;
  -moz-animation: hc1 0.3s;
 /* Firefox */
  -webkit-animation: hc1 0.3s;
 /* Safari and Chrome */
  animation-iteration-count: infinite;
  animation-timing-function: linear;
    /*background: url(data:image/gif;base64,R0lGODlhCwAKAJEDAPyZCveDBuJmBP///yH5BAEAAAMALAAAAAALAAoAAAIdhD1zopgTXgMpsBdylVCPK2UCKI0j95hoRa0NVwAAOw==);*/;
}

.bpui-slider-handle:hover
{
  border-radius: 13px 3px !important;
  animation: hc2 0.08s;
  -moz-animation: hc2 0.08s;
 /* Firefox */
  -webkit-animation: hc2 0.08s;
 /* Safari and Chrome */
  animation-iteration-count: infinite;
  animation-timing-function: linear;
    /*background: url(data:image/gif;base64,R0lGODlhCwAKAJEDAPyZCveDBuJmBP///yH5BAEAAAMALAAAAAALAAoAAAIdhD1zopgTXgMpsBdylVCPK2UCKI0j95hoRa0NVwAAOw==);*/;
}
}
